    { date: "12/072025", Name: "Kim", value: "750" },
    { date: "12/072027", Name: "Maryo", value: "850" },
  ];
  return (
    <div className='expense-item'>
      <ExpenseDate />
      <div className='expense-item__description'>
        <h2>Title</h2>
        <div className='expense-item__price'>Amount</div>
      </div>
    </div>
  );
};

export default App;
